import React from "react";
import {IconButton, TextField} from "@mui/material";

export default function ProductCards() {
  return (
    <section className="cart container">
      <div className="row">
        <div className="content col-12 col-md-8">
          <div className="title-list">
            <h1 className="font-weight-bold">Giỏ hàng</h1>
          </div>
          <div className="list-product container" style={{backgroundColor: "#fff"}}>
            <div className="item-product row py-3">
              <div className="img-product-container col-4">
                <img src={"/Uploads/manga/1.png"} className={"card-img-top img-product"}/>
              </div>
              <div className="detail-product col-8 text-left">
                <div className="title-product">
                  <h5 className={"font-weight-bold"}>Boku girl</h5>
                </div>
                <div className="action-product d-flex">
                  <div className="minus-btn">
                    <IconButton sx={{
                      width: { sm: 50 },
                      "& .MuiInputBase-root": {
                        height: 40
                      }
                    }}>
                      <i className="fa fa-minus" aria-hidden="true"></i>
                    </IconButton>
                  </div>
                  <div className="amount">
                    <TextField value={"2"} sx={{
                      width: { sm: 50 },
                      "& .MuiInputBase-root": {
                        height: 40,
                      },
                      padding: 0,
                    }}></TextField>
                  </div>
                  <div className="plus-btn">
                    <IconButton sx={{
                      width: { sm: 50 },
                      "& .MuiInputBase-root": {
                        height: 40
                      }
                    }}>
                      <i className="fa fa-plus" aria-hidden="true"></i>
                    </IconButton>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="check-out col-12 col-md-4"></div>
      </div>
    </section>
  );
}
